import { useState } from 'react';

const RegistrationForm = () => {
    const [activeButton, setActiveButton] = useState('user');
    const clickHandler = (e) => {
        setActiveButton(e.target.value);
    }

    (function() {
        'use strict';
        window.addEventListener('load', function() {
          // Fetch all the forms we want to apply custom Bootstrap validation styles to
          var forms = document.getElementsByClassName('needs-validation');
          // Loop over them and prevent submission
          var validation = Array.prototype.filter.call(forms, function(form) {
            form.addEventListener('submit', function(event) {
              if (form.checkValidity() === false) {
                event.preventDefault();
                event.stopPropagation();
              }
              form.classList.add('was-validated');
            }, false);
          });
        }, false);
      })();

    return (
        <div className="container align-items-center justify-content-center">
            <div className="px-4 py-5 my-5 text-center">
                <h1 className="display-5 fw-bold">Register Now!</h1>
                <div className="col-lg-6 mx-auto">
                    <p className="lead mb-4">Get registered now!</p>
                    <div className="d-grid gap-2 d-sm-flex justify-content-sm-center">
                        <button type="button" className={`btn btn-outline-dark btn-lg px-3 shadow-none ${activeButton==='patient'? 'active': ' '}`} onClick={clickHandler} value='patient'>Patient</button>
                        <button type="button" className={`btn btn-outline-dark btn-lg px-3 shadow-none ${activeButton==='doctor'? 'active': ' '}`}  onClick={clickHandler} value='doctor'>Doctor</button>
                    </div>
                </div>
            </div>
            <div className="container"> 
                <form className="row g-3">
                    <div className="col-md-2">
                        <label htmlFor="patient_id" className="form-label">Patient ID</label>
                        <input type="text" className="form-control" id="patient_id" placeholder="Patient ID" disabled readOnly/>
                    </div>
                    <div class="col-md-4">
                        <label htmlFor="name" class="form-label">Name</label>
                        <input type="text" class="form-control" id="name" placeholder="Name" disabled/>
                    </div>
                    <div class="col-md-2">
                        <label htmlFor="age" class="form-label">Age</label>
                        <input type="text" class="form-control" id="age" placeholder="Age" disabled/>
                    </div>
                    <div class="col-md-4">
                        <label htmlFor="mobile" class="form-label">Mobile</label>
                        <input type="text" class="form-control" id="mobile" placeholder="Mobile" disabled/>
                    </div>
                    <div class="col-12">
                        <label for="diagnosis" class="form-label">Diagnosis</label>
                        <textarea class="form-control" id="diagnosis" rows="3"></textarea>
                    </div>
                    <div class="col-12">
                        <label for="medicines" class="form-label">Medicines</label>
                        <textarea class="form-control" id="medicines" rows="3"></textarea>
                    </div>
                    <div class="col-12">
                        <label for="prognosis" class="form-label">Prognosis</label>
                        <textarea class="form-control" id="prognosis" rows="3"></textarea>
                    </div>
                    
                    <div class="col-12">
                        <button type="submit" class="btn btn-primary">Sign in</button>
                    </div>
                </form>

            </div>
        </div>
    )
}

export default RegistrationForm
